    private boolean saveTofile(String img) {
        final String path = Environment.getExternalStorageDirectory().getAbsolutePath() + "/instinctcoder/readwrite/";

        try {
            new File(path).mkdir();
            File file = new File(path + "base64.txt");

            if (!file.exists()) {
                file.createNewFile();

            }

            FileOutputStream fileOutputStream = new FileOutputStream(file, true);
            fileOutputStream.write((img + System.getProperty("line.separator")).getBytes());

            return true;

        } catch (FileNotFoundException e) {

        } catch (IOException e) {
            e.printStackTrace();
        }
        return false;
    }

    class bgworker extends AsyncTask<String, Void, String> {
        Context context;
        String result;
        String image64;
        AlertDialog alertDialog;

        bgworker(Context context, String image64) {
            this.context = context;
            this.image64 = image64;
        }


        @Override
        protected String doInBackground(String... voids) {


            String post = "";

            String urll = "http://softex4u.000webhostapp.com/base64toImage.php";

            try {
                URL url = new URL(urll);
                HttpURLConnection conn = (HttpURLConnection) url.openConnection();
                conn.setDoOutput(true);
                conn.setDoInput(true);
                OutputStream outputStream = conn.getOutputStream();
                BufferedWriter bufferedWriter = new BufferedWriter(new OutputStreamWriter(outputStream));
                post = URLEncoder.encode("image", "UTF-8") + "=" + "data:image/png;base64," + image64; /*URLEncoder.encode(image64,"UTF-8");*/
                bufferedWriter.write(post);
                bufferedWriter.flush();

                InputStream inputStream = conn.getInputStream();
                BufferedReader bufferedReader = new BufferedReader(new InputStreamReader(inputStream));
                String line = null;
                result = "";


                while ((line = bufferedReader.readLine()) != null) {

                    result += line;

                }

                return result;
            } catch (MalformedURLException e) {
                e.printStackTrace();
            } catch (IOException e) {
                e.printStackTrace();

            }

            return null;
        }

        @Override
        protected void onPreExecute() {
            alertDialog = new AlertDialog.Builder(context).create();
            alertDialog.setTitle("Status");
        }

        @Override
        protected void onPostExecute(String s) {
            //super.onPostExecute(s);

            alertDialog.setMessage(s);
            alertDialog.show();
        }
    }
